import React from 'react'
import infovideo from '../assets/infomercial.mp4'

const Infomercial = () => {
    return(
        <div>
            <div>Take a further look</div>
            <iframe className='infovideo' width="420" height="315"
                src="https://www.youtube.com/embed/-AiULl6dU4Q">
            </iframe>
        </div>
    )
}

export default Infomercial
